---
swagger: "2.0"
info:
  description: CEMIG-SPED-PDF-EXTRACTOR
  version: 1.0.0
  title: SPED PDF Data Extractor
host: localhost
basePath: /api/v1/
schemes:
- https
paths:
  /crawly/sped:
    post:
      summary: Receive a PDF file encoded as base64
      consumes:
      - application/json
      produces:
      - application/json
      parameters:
      - in: body
        name: body
        description: pdf input
        required: true
        schema:
          ../../ref: '#/definitions/PDFPayload'
      responses:
        "200":
          description: PDF processed successfully
          schema:
            ../../ref: '#/definitions/PDFResponse'
        "500":
          description: invalid input or conditions to run
definitions:
  PDFPayload:
    type: object
    properties:
      pdf:
        type: string
        format: base64
        example: 
  PDFResponse:
    type: object
    properties:
      items:
        type: array
        description: PDF Extracted data items
        items:
          ../../ref: '#/definitions/PDFResponseItem'
  PDFResponseItem:
    type: object
    properties:
      dataReferencia:
        type: string
      cnpj:
        type: string
      entidade:
        type: string
      tipo:
        type: string
        enum: [B, D]
        description: Indica se o registro é proveniente do SinonimosBalanco (B) ou SinonimosDemonstracao (D)
      receitaBruta:
        type: string
      lucroBruto:
        type: string
      prejuizoAntesDoImpostoDeRendaEDacontribuicaoSocial:
        type: string
      despesasReceitasOperacionais:
        type: string
